actionConfiguration.body:
() => {
		var result = [];

		for (let i = 0; i < appsmith.store.StockOnHandListValue.length; i++){
			let storagelocation = ""
			if (appsmith.store.StockOnHandListValue[i].storageLocation != null){
				storagelocation = appsmith.store.StockOnHandListValue[i].storageLocation.name
			}
			let materialCode = ""
			if (appsmith.store.StockOnHandListValue[i].material != null){
				materialCode = appsmith.store.StockOnHandListValue[i].material.code
			}
			let materialSublot = ""
			if (appsmith.store.StockOnHandListValue[i].materialSubLot != null){
				materialSublot = appsmith.store.StockOnHandListValue[i].materialSubLot.code
			}
			let shipmentId = ""
			if (appsmith.store.StockOnHandListValue[i].shipment != null){
				shipmentId = appsmith.store.StockOnHandListValue[i].shipment.id
			}
			let line = {
				"materialCode":materialCode,
				"effectiveTimeStamp":appsmith.store.StockOnHandListValue[i].effectiveTimestamp,
				"quantity":appsmith.store.StockOnHandListValue[i].quantity,
				"materialSubLot":materialSublot,
				"storageLocation":storagelocation,
				"shipment":shipmentId,
				"reason":appsmith.store.StockOnHandListValue[i].reason
			}
			result.push(line)
		}
		return result
	}

